import React from "react";
import "./StorePage.css";

function StorePage() {
  return (
    <div id="store-page">
      <div>
        <img src="../assets/backsplash_placeholder.png" id="backsplash"></img>
      </div>
    </div>
  );
}

export default StorePage;
